import React from 'react'

function PopUpNote (props) {

  const handleNote = (key, event) => {
    console.log(props)
   props.onPopUpNote(key, event)
  }

  return (
    <button
      className='note-btn'
      onClick={event => handleNote(props.item.id, event)}
    >
    Note
    </button>

  )
}

export default PopUpNote
